import React from 'react';
import './card-list.css';

const CardList = props => {
  console.log(props);
  const { monster } = props;
  return (
    <div className="card-list">
      {monster.map(monsterName => {
        return <h1 key={monsterName.id}>{monsterName.name}</h1>;
      })}
    </div>
  );
};
export default CardList;
